import React from 'react';

import Layout from './components/Layout';
import Toggle from './components/Toggle';
import ContextProvider from './context/ContextProvider';
export default class App extends React.Component {
	render() {
		return (
			<ContextProvider>
				<Layout>
					<Toggle />
				</Layout>
			</ContextProvider>
		);
	}
}
